import React, { Component } from 'react'

export default class Item extends Component {
  render() {
    const { id,name,from,date } = this.props
    return (
      <div>
        <h2>{id}.{name}</h2>
        <h3>{from}{date}</h3>
      </div>
    )
  }
}
